import React, { useState, useEffect, useCallback } from 'react';
import axios from 'axios';
import FlightCard from '../components/FlightCard';
import Payment from '../components/Payment';

const Flights = () => {
  const [flights, setFlights] = useState([]);
  const [from, setFrom] = useState('');
  const [to, setTo] = useState('');
  const [selectedFlight, setSelectedFlight] = useState(null);
  const [seats, setSeats] = useState(1);

  // ‚úÖ Fetch Flights with token authorization
  const fetchFlights = useCallback(async () => {
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        alert('Please log in to view flights.');
        window.location.href = '/login';
        return;
      }

      const res = await axios.get('http://localhost:5000/api/flights', {
        headers: { Authorization: `Bearer ${token}` },
        params: { source: from, destination: to },
      });

      console.log('üõ´ Flights response:', res.data);

      // ‚úÖ Handle both response formats (array or object)
      if (Array.isArray(res.data)) {
        setFlights(res.data);
      } else if (res.data.flights) {
        setFlights(res.data.flights);
      } else {
        setFlights([]);
      }
    } catch (err) {
      console.error('‚ùå Error fetching flights:', err);
      alert('Failed to fetch flights. Please check backend or login again.');
    }
  }, [from, to]);

  // Handle search form submission
  const handleSearch = (e) => {
    e.preventDefault();
    fetchFlights();
  };

  // Handle flight selection
  const handleSelectFlight = (flight) => {
    setSelectedFlight(flight);
    setSeats(1);
  };

  // Fetch all flights on mount
  useEffect(() => {
    fetchFlights();
  }, [fetchFlights]);

  return (
    <div style={{ padding: '2rem', color: 'black' }}>
      <h2 style={{ fontSize: '40px', marginBottom: '1rem' }}>‚úàÔ∏è Search Flights</h2>

      {/* Search form */}
      <form
        onSubmit={handleSearch}
        style={{ display: 'flex', gap: '0.5rem', marginBottom: '1.5rem' }}
      >
        <input
          type="text"
          placeholder="From"
          value={from}
          onChange={(e) => setFrom(e.target.value)}
          style={{
            flex: 1,
            padding: '0.6rem',
            borderRadius: '6px',
            border: '1px solid #ccc',
          }}
          required
        />
        <input
          type="text"
          placeholder="To"
          value={to}
          onChange={(e) => setTo(e.target.value)}
          style={{
            flex: 1,
            padding: '0.6rem',
            borderRadius: '6px',
            border: '1px solid #ccc',
          }}
          required
        />
        <button
          type="submit"
          style={{
            padding: '0.6rem 1.2rem',
            backgroundColor: '#007bff',
            color: 'white',
            border: 'none',
            borderRadius: '6px',
            cursor: 'pointer',
          }}
        >
          Search
        </button>
      </form>

      {/* Flights List */}
      <div>
        {flights.length > 0 ? (
          flights.map((flight) => (
            <FlightCard
              key={flight._id}
              flight={flight}
              onSelect={() => handleSelectFlight(flight)}
            />
          ))
        ) : (
          <p>No flights found</p>
        )}
      </div>

      {/* Selected Flight & Payment Section */}
      {selectedFlight && (
        <div
          style={{
            marginTop: '2rem',
            padding: '1.5rem',
            border: '1px solid #ccc',
            borderRadius: '10px',
            boxShadow: '0 0 10px rgba(0,0,0,0.1)',
          }}
        >
          <h3>
            Booking for: {selectedFlight.airline} ‚Äî {selectedFlight.flightNumber}
          </h3>
          <p>
            From: {selectedFlight.source} ‚Üí To: {selectedFlight.destination}
          </p>
          <p>Price per seat: ‚Çπ{selectedFlight.price}</p>

          <div style={{ margin: '1rem 0' }}>
            <label>
              Seats:{' '}
              <input
                type="number"
                min="1"
                max={selectedFlight.seatsAvailable || 10}
                value={seats}
                onChange={(e) => setSeats(Number(e.target.value))}
                style={{
                  padding: '0.4rem',
                  width: '80px',
                  borderRadius: '6px',
                  border: '1px solid #ccc',
                }}
              />
            </label>
          </div>

          <p>
            <strong>Total: ‚Çπ{selectedFlight.price * seats}</strong>
          </p>

          {/* Dummy Stripe Payment Integration */}
          <Payment amount={selectedFlight.price * seats * 100} />
        </div>
      )}
    </div>
  );
};

export default Flights;
